import React from 'react';
import { Dash } from './dash';


export class Signin extends React.Component{
    render(){
        return(
            <div>
                <form>
                    username<input typr="text"/>
                    password<input type="password"/>
                    <button onClick={<Dash></Dash>}>Login</button>
                </form>
            </div>
        )
    }
}
